INSERT INTO webshop.base_item (dtype, article_number, deleted, description, name, price, stock, brand, color, material, weight, category_c_id, image) VALUES ('single', 1202111, false, '"Noodles" von Stafil ist ein qualitativ hochwertiges Textilgarn, dass aus den Resten der Mode- und Textilindustrie hergestellt wird.
Mit dem Jerseygarn "Noodles" von Stafil kann man superschnell und einfach im Riesenformat stricken und häkeln, flechten, knüpfen etc.

Der Kreativität sind keine Grenzen gesetzt!

Stricken mit dem Jerseygarn "Noodles" von Stafil, ist nicht nur schonend für die Umwelt, sondern bringt auch eine Extraportion Spass und Motivation. Denn bei keinem anderen Garn sind nach wenigen Maschen und Reihen so schnell Ergebnisse sichtbar.


Körbe, Kissen, Taschen, Poufs, Armbänder und sogar Teppiche entstehen in kürzester Zeit.', 'Noodles grün', 10.5, 82, 'Stafil', 'grün', 'Baumwolle', 750, 11, );
